description:
Marilyn Monroe: Still Life

Biography Documentary with no narration published by PBS broadcasted as part of PBS American Masters series in 2006 - English language


Information
------------------------------

Marilyn Monroe was, arguably, the most photographed person ever. &quot;Marilyn Monroe: Still Life,&quot; from AMERICAN MASTERS, tells her story through interviews with photographers such as Eve Arnold, Arnold Newman, Elliott Erwitt, George Zimbel and Phil Stern, and especially through the photos themselves, an ageless testament to her grace, guts and sexiness - her humor and vulnerability. She understood their power and she exploited it. She created, and curated, her own image. Though she died 50 years ago, Monroe persists in her image.

